import React, {useState} from 'react';
import './Navbar.css'
function Navbar() {


  return (
<main class="main__wrapper">
  <div className="main__logoBox">HERE WILL BE THE LOGO!</div>
  <span className="main__highHalf">
  <section className="main__section0">
    <div className="close-section">&times;</div>
    {/* <div className="demo-box">Section 1</div> */}
  </section>
  <section className="main__section1">
    {/* <div className="close-section">&times;</div> */}
    <div className="demo-box">Section 2</div>
  </section>
  </span>
  <span className="main__downHalf">
  <section className="main__section2">
    <div className="close-section">&times;</div>
    <div className="demo-box">Section 3</div>
  </section>
  <section className="main__section3">
    <div className="close-section">&times;</div>
    <div className="demo-box">Section 4</div>
  </section>
  </span>
</main>
  );
}

export default Navbar;
